import React, {useState} from 'react';
import ReduxHOC from "../src/components/reduxHOC";
import { useSelector, useDispatch } from 'react-redux'



const Hook = () => {
    const [count] = useState(0);

    return (
        <div>
            {count}
        </div>
    );
};

export default ReduxHOC(Hook);
